#!/usr/bin/python

def get_starting_positions(genome, pattern, num_mismatch):
    i = 0 
    indexes = []
    while i < len(genome) - len(pattern):
        #  print(genome[i: i + len(pattern)], pattern)
        if is_d_mismatches(genome[i: i + len(pattern)], pattern, num_mismatch):
            indexes.append(i)
        i += 1
    return indexes

def is_d_mismatches(substring, pattern, num_mismatch):
    count = 0
    for i, nuc in enumerate(substring):
        if nuc != pattern[i]:
            count += 1
    if count <= num_mismatch:
        return True
    else:
        return False

def print_list(indexes):
    for pos in indexes:
        print(pos, end = ' ')

if __name__ == "__main__":
    genome = ''
    pattern = 'GCCCTCGTCC'
    num_mismatch = 6
    indexes = get_starting_positions(genome, pattern, num_mismatch)
    print_list(indexes)


